import React from 'react';

const Footer = () => {
  const footerStyle = {
    textAlign: 'center',
    padding: '20px',
    backgroundColor: '#333',
    color: 'white',
    position: 'fixed',
    width: '100%',
    bottom: 0
  };

  return (
    <footer style={footerStyle}>
      <p>Designed and Maintained by AIDS Dept., SCET, Surat</p>
    </footer>
  );
};

export default Footer;
